import ExpenseItem from './components/ExpenseItem';

function App() {
  const expenses = [
    {id: 'e1', title: 'Car Insurance', amount: 198.67, date: new Date(2021, 2, 28)},
    {id: 'e2', title: 'Internet Bill', amount: 300.00, date: new Date(2021, 6, 19)},
    {id: 'e3', title: 'Petrol Expense', amount: 1500.00, date: new Date(2021, 8, 24)},
    {id: 'e3', title: 'House Tax', amount: 700.00, date: new Date(2021, 11, 2)}
  ];
  return (
    <div>
      <h2>Expense Manager</h2>
      <ExpenseItem expense={expenses}/>
    </div>
  );
}

export default App;
